import React from 'react';
import { Form, Input } from 'antd';
const Register = () => {
  return (
    <div className='register'>
      <div className='row'>
        <div className='col-md-5'>{/* 左侧图片 */}</div>
        <div className='col-md-4'>
          {/* form表单 */}
          <Form>
            <Form.Item>
              <Input />
            </Form.Item>
          </Form>
        </div>
      </div>
    </div>
  );
};

export default Register;
